Identifiant de licence, étant un identifiant unique à l'échelle mondiale pour une licence ou un contrat en vertu duquel des articles sont générés, soumis pour traitement et/ou payés, qui est construit en concaténant :
 - un code d'agence émettrice ISO/IEC 15459; - un numéro de licence ou de contrat qui est conforme aux spécifications de l'agence émettrice concernée;
et qui :
 - ne comprend que des caractères alphabétiques majuscules et/ou numériques;
 - est unique (c'est-à-dire, est distinct de tout autre identifiant conforme à l'ISO/IEC 15459) dans le domaine de l'agence émettrice;
 - ne peut être dérivé d'aucun autre identifiant conforme à l'ISO/IEC 15459, émis sous la même agence émettrice, par la simple addition de caractères à, ou leur retrait de, son extrémité.

Code de zone de pêche de la FAO tel que défini par le Département des pêches et de l'aquaculture de la FAO (http://www.fao.org. Rechercher le sous-site Code de zone de pêche).
Tous les caractères du sous-ensemble de l'ISO/IEC 646 défini dans les spécifications générales de GS1 sont autorisés.
Exemples:
18L37.1.3 Mer Méditerranée occidentale, Sardaigne;
18L47.B.1 Atlantique, Sud-Est, Division SEAFO, ZEE de Namibie;
18L67 Pacifique, Nord-Est.

Code de localisation '26L', étant un code identifiant un emplacement ou une zone géographique, ou un groupe associé de tels emplacements ou zones, qui a une pertinence pour une transaction liée et qui est conforme à l'une des structures définies dans (a) à (f) ci-dessous:
a) deux caractères alphabétiques majuscules correspondant au code de pays à deux alpha ISO 3166-1 du pays dans lequel, ou constitué de celui-ci, l'emplacement(s) ou la zone(s) sont situés;
b) trois caractères alphabétiques majuscules correspondant au code IATA de l'aéroport ou de la ville dans, proche de, ou constitué de celui-ci, l'emplacement(s) ou la zone(s) sont situés;
c) quatre caractères ou plus dont les trois premiers correspondent à un code de pays ISO 3166-1 suivi d'un tiret (-), avec le solde étant un code postal dans le pays concerné;
d) quatre caractères ou plus dont les trois premiers correspondent à un code de pays ISO 3166-1 suivi d'un point (.), avec le solde étant un code de subdivision de pays ISO 3166-2 dans le pays concerné;
e) cinq caractères alphabétiques majuscules correspondant au code UN/LOCODE de la zone dans, proche de, ou constitué de celui-ci, l'emplacement(s) ou la zone(s) sont situés;
f) la concaténation, étant pas moins de sept ou plus de 35 caractères de longueur, de:
- un code d'agence émettrice ISO/IEC 15459;
- un code d'emplacement, constitué de caractères tirés de l'ensemble {A-Z; 0-9} qui est conforme aux spécifications de l'agence émettrice concernée.

Emplacement de l'événement UN/LOCODE.Code UN/LOCODE suivi d'un caractère plus (+) suivi d'une ou plusieurs valeurs de code de la liste de codes EDIFACT 3227 'Qualificateur de code de fonction d'emplacement', par exemple,
7 Lieu de livraison finale;
5 Port de départ;
9 Port de chargement;
11 Port de déchargement;
13 Lieu de transbordement;
24 Port d'entrée;
35 Pays d'exportation;
88 Lieu de réception par le transporteur;
125 Port étranger avant le départ vers les États-Unis;
147 Cellule de stivage/position;
159 Lieu de livraison (au destinataire);
248 Lieu de chargement
http://www.unece.org/cefact/locode/.

