Méthode de production pour les poissons et fruits de mer telle que spécifiée par le Département des pêches et de l'aquaculture de l'Organisation des Nations Unies pour l'alimentation et l'agriculture (FAO), conformément au règlement de l'UE 1379/2013. (www.fao.org).
