Identifiant d'équipement, étant un identifiant mondial unique pour un dispositif, un article d'équipement ou une instance d'une application informatique utilisée dans la production, le transport, le traitement ou d'autres manipulations d'articles, qui est construit en concaténant :
 - un code d'agence d'émission ISO/IEC 15459 ;
 - un numéro d'équipement qui est conforme aux spécifications de l'agence d'émission concernée ; et qui :
 - ne comprend que des caractères alphabétiques en majuscules et/ou numériques ;
 - est unique (c'est-à-dire, est distinct de tout autre identifiant conforme à l'ISO/IEC 15459) dans le domaine de l'agence d'émission ;
 - ne peut pas être dérivé d'un autre identifiant conforme à l'ISO/IEC 15459, émis sous la même agence d'émission, par l'ajout simple de caractères à, ou leur retrait de, son extrémité.
Identifiant de lecteur.
Identifiant d'équipement, étant un identifiant mondial unique pour un dispositif, un article d'équipement ou une instance d'une application informatique utilisée dans la production, le transport, le traitement ou d'autres manipulations d'articles.

Code de Localisation UPU, étant un code identifiant un lieu ou une zone géographique, ou un groupe associé de tels lieux ou zones, ayant une pertinence pour une transaction associée et qui est conforme à l'une des structures définies en a) à g) ci-dessous :
a) deux caractères alphabétiques majuscules correspondant au code de pays ISO 3166-1 à deux alpha du pays dans lequel, ou consistant en, le(s) lieu(x) ou la zone(s) sont situés ;
b) trois caractères alphabétiques majuscules correspondant au code IATA de l'aéroport ou de la ville dans, proche de, ou consistant en, le(s) lieu(x) ou la zone(s) sont situés ;
c) quatre caractères ou plus dont les trois premiers correspondent à un code de pays ISO 3166-1 suivi d'un tiret (-), le reste étant un code postal dans le pays concerné ;
d) quatre caractères ou plus dont les trois premiers correspondent à un code de pays ISO 3166-1 suivi d'un point (.), le reste étant un code de subdivision de pays ISO 3166-2 dans le pays concerné ;
e) cinq caractères alphabétiques majuscules correspondant au code UN/LOCODE de la zone dans, proche de, ou consistant en, le(s) lieu(x) ou la zone(s) ;
f) six caractères alphanumériques majuscules correspondant à un code IMPC UPU attribué conformément à la norme UPU S34 ;
g) la concaténation, ne faisant pas moins de sept ni plus de 25 caractères de longueur, de :
 - un code émetteur attribué conformément aux normes UPU S31 ;
 - un code de localisation, consistant en caractères tirés de l'ensemble {A-Z; 0-9} qui est conforme aux spécifications de l'émetteur concerné.

Plaque d'Immatriculation avec Données de Service et Code de Localisation est une construction de données composée, conforme à la spécification de la norme UPU S25, qui inclut la spécification de :
 - un identifiant d'article conforme à l'ISO/IEC 15459 ;
 - une spécification conforme à l'identifiant de données 5U du service à fournir en ce qui concerne l'article ;
 - un code de localisation UPU conforme à l'identifiant de données 17U ou un code de localisation UPU qualifié conforme à l'identifiant de données 18U.
 Note - Pour plus de détails, veuillez vous référer à la norme UPU S25. La distinction entre un code de localisation UPU simple (DI 17U) et un code de localisation UPU qualifié (DI 18U) peut être déterminée à partir du premier caractère. Si celui-ci est numérique, 18U s'applique ; s'il est alphabétique, 17U s'applique.

Événement, Date et Heure.
Format ISO AAAAMMJJHHMM (horloge 24 heures - UTC) immédiatement suivi d'un Qualificateur de Code UN/EDIFACT 2005 fournissant un code spécifiant le type de date), par exemple,
11 [Date prévue d'expédition/envoi des marchandises lors de l'émission du message.];
17 [Date/heure estimée de livraison lorsque les marchandises sont attendues pour être livrées];
