118 [Confirmation de Réservation];
129 [Date où le navire/marchandise a quitté le dernier port étranger dans le pays exportateur.];
132 [Date/heure à laquelle le transporteur estime qu'un moyen de transport devrait arriver au port de déchargement ou au lieu de destination.];
133 [Date/heure à laquelle le transporteur estime qu'un moyen de transport devrait partir du lieu de départ];
137 [Date/heure à laquelle le fournisseur expédie les pièces en fonction de la demande du client. (Date d'émission du DESADV. La recommandation est que le DESADV soit émis dans les 30 minutes suivant le ramassage des marchandises chez la partie ShipFrom];
146 [Date estimée d'Entrée (Douanes) date à laquelle la date officielle d'une Entrée en Douane est anticipée.];
151 [Date d'Importation (Arrivée au port avec intention de décharger)];
186 Départ d'une Installation ('Sortie de portail)];
204 [Date à laquelle les Douanes libèrent la marchandise au transporteur ou à l'importateur];
253 [Départ d'un Port ('Départ du Navire')];
252 [Arrivée à un Port ('Arrivée du Navire')];
283 [Arrivée à une Installation ('Entrée de portail)];
342 [Chargement de Convoi];
351 [Inspection de Portail de Terminal];
411 [Ordre de Remplissage];
412 [Ordre de Déchargement];
420 [Déchargement de Convoi];
534 [Réparation];
677 [Confirmation de Remplissage];
678 [Confirmation de Déchargement];
696 [Date de Dépôt].

Date, représentée sous forme modifiée conforme à UTC :
aaaa[mm[jj[hh[mm[ss[fff]]]]]][poooo] où les crochets indiquent l'optionnalité et aaaa est l'année, mmjj le mois et le jour, hhmmss l'heure du jour en heures minutes et secondes, fff les fractions de sections et poooo le décalage par rapport à UTC exprimé en heures et minutes, le décalage étant positif si p est un point (.), négatif si P est un signe moins (-).
EXEMPLE :
2005 - (UTC) année calendaire 2005 ;
200505 - (UTC) mois calendaire Mai 2005 ;
20050518 - (UTC) 18 Mai 2005 ;
200505181247 - 12:47 UTC le 18 Mai 2005 ;
200505181247.0100 - 12:47 heure locale, soit 11:47 UTC, le 18 Mai 2005 ;
20050518124723099 - 99 millisecondes après 12:47:23 UTC le 18 Mai 2005.

Date Qualifiée, comprenant la concaténation de :
- un code d'agence émettrice ISO/IEC 15459 ;
- un qualificateur de date conforme aux spécifications de cette agence émettrice ;
- une date dont le format et l'interprétation sont conformes aux spécifications de l'agence émettrice pour ce qualificateur de date.

Déclaration de Catégorie de Matériau d'Emballage*, Code* et Poids pour un matériau d'emballage donné utilisé dans un emballage donné selon la directive européenne sur les emballages et les déchets d'emballage. (Catégorie de matériau et code définis dans l'Annexe M).
12ECCMMMMMMNNNNNUU où : - '12E' (an3) est l'Identifiant de Données ;
 - 'CC' (n2) est la Catégorie de Matériau selon l'Annexe M ;
 - 'MMMMMM' (an1...6) est le Code de Matériau selon l'Annexe M ;
 - 'NNNNN' (n5) Poids du Matériau, incluant le point décimal (par exemple, 12.12) ;
 - 'UU' (an2) est l'Unité de mesure pour le poids (par exemple, KG, GR, LB ou OZ selon ANSI X12.3 comme dans l'Annexe D).

