ST [Envoyer À];
UC [Consignataire Ultime].

Numéro de Consignataire.
Le numéro d'identification unique peut être l'IRS, EIN, SSN ou le numéro attribué par le CBP, selon les exigences du Filing de Sécurité. Seuls les formats suivants doivent être utilisés : IRS EIN : NN-NNNNNNN;
IRS EIN avec suffixe :
NN-NNNNNNNXX;
SSN : NNN-NN-NNNN;
Numéro attribué par CBP : YYDDPP-NNNNN.
